import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Rating = () => {
  const [items, setItems] = useState([]); // Students or Lectures to rate
  const [ratings, setRatings] = useState([]);
  const [message, setMessage] = useState('');
  const [role, setRole] = useState(null);
  const [formData, setFormData] = useState({ rating: '', comment: '' });

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) return;
    const decoded = JSON.parse(atob(token.split('.')[1])); // Decode JWT
    setRole(decoded.role);
    fetchItems(decoded.role);
    fetchRatings();
  }, []);

  // Fetch students for lecturer or lectures for student
  const fetchItems = async (role) => {
    try {
      const endpoint = role === 'lecturer' ? '/students-to-rate' : '/lectures-to-rate';
      const res = await axios.get(`${process.env.REACT_APP_API_URL}${endpoint}`, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setItems(res.data || []);
    } catch (err) {
      console.error('Fetch items error:', err);
    }
  };

  const fetchRatings = async () => {
    try {
      const res = await axios.get(`${process.env.REACT_APP_API_URL}/rating`, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setRatings(res.data.ratings || []);
    } catch (err) {
      console.error('Fetch ratings error:', err);
    }
  };

  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleSubmit = async (id) => {
    try {
      const payload = {
        target_id: id,
        rating: formData.rating,
        comment: formData.comment
      };
      const res = await axios.post(`${process.env.REACT_APP_API_URL}/rating`, payload, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setMessage(res.data.message);
      setFormData({ rating: '', comment: '' });
      fetchRatings(); // refresh ratings
    } catch (err) {
      setMessage(err.response?.data?.message || 'Error submitting rating');
      console.error('Rating submit error:', err);
    }
  };

  return (
    <div className="rating-container">
      <h2>{role === 'lecturer' ? 'Rate Students' : 'Rate Lectures'}</h2>
      {message && <p className="rating-message">{message}</p>}

      <div className="rating-list">
        {items.length === 0 && <p>No items to rate.</p>}
        {items.map(item => (
          <div key={item.id} className="rating-card">
            <p><strong>{role === 'lecturer' ? 'Student:' : 'Lecture:'}</strong> {item.name}</p>
            <input
              type="number"
              name="rating"
              placeholder="Rating (1-5)"
              min="1"
              max="5"
              value={formData.rating}
              onChange={handleChange}
              className="rating-input"
            />
            <textarea
              name="comment"
              placeholder="Comment (optional)"
              value={formData.comment}
              onChange={handleChange}
              className="rating-textarea"
            />
            <button onClick={() => handleSubmit(item.id)} className="rating-btn">
              Submit Rating
            </button>
          </div>
        ))}
      </div>

      <h3>All Ratings</h3>
      <div className="all-ratings">
        {ratings.length === 0 && <p>No ratings yet.</p>}
        {ratings.map(r => (
          <div key={r.id} className="rating-card">
            <p><strong>Lecture ID:</strong> {r.lecture_id}</p>
            <p><strong>Student ID:</strong> {r.student_id}</p>
            <p><strong>Lecturer ID:</strong> {r.lecturer_id}</p>
            <p><strong>Rating:</strong> {r.rating}</p>
            <p><strong>Comment:</strong> {r.comment || '-'}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Rating;
